import { useEffect, useState } from "react"
import { useNavigate } from "react-router-dom"

import "./BookingForm.css"

export const BookingForm = () => {

    const [genres, setGenres] = useState([])
    const [client, setClients] = useState([])
    const [requests, setRequests] = useState([])

    const localFatBackUser = localStorage.getItem("fatback_user")
    const fatbackUserObject = JSON.parse(localFatBackUser)


    const [request, setBookingForm] = useState({

        bandName: "",
        phoneNumber: "",
        genreId: 0,
        numOfSongs: "",
        startDate: "",
        endDate: "",
        musicianRequest: false,
        sessionMusicians: false,
        photoRequest: false,
        videoRequest: false,
        userId: fatbackUserObject.id

    })

    const navigate = useNavigate()

    useEffect(
        () => {
            fetch(`http://localhost:8088/genres`)
                .then(response => response.json())
                .then((genreArray) => {
                    setGenres(genreArray)
                })
        },
        []

    )

    useEffect(
        () => {
            fetch(`http://localhost:8088/clients?&_embed=requests`)
                .then(response => response.json())
                .then((genreArray) => {
                    setClients(genreArray)
                })
        },
        []

    )

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests?_expand=genre&userId=${fatbackUserObject.id}`)
                .then(response => response.json())
                .then((requestInfo) => {
                    setRequest(requestInfo)
                })
        }, []
    )


    const submitButtonClick = (event) => {
        event.preventDefault()

        return fetch(`http://localhost:8088/requests`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(request)
        })

            .then(response => response.json())
            .then(() => {
                navigate(`/myrequest`)
            })

    }

    return (
        < div className="bookingForm" >
            <h2 className="bookingHeader">Booking Form</h2>
            <form>

                <fieldset >
                    <div className="form-group">
                        <label className="label" htmlFor="bandName">Band Name: </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            value={request.bandName}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.bandName = event.target.value
                                    setBookingForm(copy)
                                }
                            }
                        />
                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label className="label" htmlFor="phoneNumber">
                            Phone Number:
                        </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"

                            value={request.phoneNumber}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.phoneNumber = event.target.value
                                    setBookingForm(copy)
                                }
                            }
                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label className="label" htmlFor="genre">Choose a genre:</label>
                        <select id="genre" required
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.genreId = parseInt(event.target.value)
                                    setBookingForm(copy)
                                }}>
                            <option value="0">Genre...</option>

                            {
                                genres.map(
                                    (genre) => {
                                        return <option
                                            key={`genre--${genre.id}`}
                                            value={genre.id}
                                            genrearray={genres}>{genre.type}
                                        </option>
                                    }
                                )
                            }
                        </select>

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label className="label" htmlFor="songs">
                            No. of Songs:
                        </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            value={request.numOfSongs}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.numOfSongs = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label className="label" htmlFor="date">
                            Start Date:
                        </label>
                        <input

                            type="date"
                            required
                            className="form-control"
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.startDate = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="date">
                            End Date:
                        </label>
                        <input
                            required
                            type="date"
                            className="form-control"
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.endDate = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
